.l-orderpad-tooltip .l-orderpad-tooltiptext {
  position: absolute;
  z-index: 1;
  visibility: hidden;
  opacity: 0;
  background: none;
  width: 100%;
  height: auto;
  font-size: 12px;
  line-height: 1.4;
