    width: 100%;
  }
}
.l-orderpad-tooltip .l-orderpad-tooltiptext::after {
  content: " ";
  position: absolute;
  top: 100% /* At the bottom of the tooltip */;
  left: 192px /* Match position of tooltip ? symbol */;
  margin-left: -9px;
  border-width: 9px;
  border-style: solid;
  border-color: #d0d0d0 transparent transparent transparent;
}
