functions.sendGoogleExperimentGoal = function(experimentName, goal, params) {
  var experiment = vonaLight.functions.getGoogleExperiment(experimentName, params);
  if (!experiment || !experiment.id) return;
  if(experiment.duration_type == 'id_series_session'){
    if(!experiment.active) return;
    //Do not send duplicate goal completions within a session
    if(sessionStorage.getItem('__experimentGoal_'+((VNServerInfo&&VNServerInfo.seriesCode)||'')+'_'+experimentName)) return;
  }
  var variation = vonaLight.functions.getGoogleExperimentVariation(experimentName, params);
  if(!variation){ console.error('Variation not found for experiment '+experimentName); return; } //eslint-disable-line no-console
  var eventParams = {
    action: experimentName,
    value: variation || 0,
    line1: goal,
    tag: experiment.id,
    unix_tm: (new Date()).getTime().toString(),
  };
  if(VNServerInfo){
    eventParams.category_code = (VNServerInfo.staticCategoryPartInfo && VNServerInfo.staticCategoryPartInfo.categoryCode) || VNServerInfo.categoryCode;
    eventParams.series_code = VNServerInfo.seriesCode;
    eventParams.brand_code = VNServerInfo.brandCode;
    if(VNServerInfo.partNumberData && (VNServerInfo.partNumberData.length==1)){
      eventParams.part = VNServerInfo.partNumberData[0].partNumber;
      eventParams.inner_code = VNServerInfo.partNumberData[0].innerCode;
    }
  }
  vonaLight.functions.ga4SendEvent('ECExperimentGoal', eventParams);

  if(experiment.duration_type == 'id_series_session'){
