/* JS for keyword cookie tracking to support Search Performance Reporting */
var backActionTrackingClass = function(functions){
  var COOKIE_ID = 'MISUMI_BACK_ACTION_COUNT';
  var WAS_BACK_ACTION_PAGE = 'MISUMI_WAS_BACK_ACTION_PAGE';

  var PAGE_RESULTS = 'PAGE_RESULTS';
  var PAGE_CATEGORY = 'PAGE_CATEGORY';
  var PAGE_SPEC = 'PAGE_SPEC';
  var PAGE_NPNL = 'PAGE_NPNL';
  var PAGE_COMPLEX = 'PAGE_COMPLEX';
  var PAGE_WYSIWYG = 'PAGE_WSYIWYG';
  var PAGE_SIMPLE = 'PAGE_SIMPLE';

  var instance = this;

  var debugEnabled = functions.getCookieValue('DEV');

  function isVerbose() {
    return debugEnabled || (window.vona2 && vona2.DEV) || (window.vonaLight_Spec && window.vonaLight_Spec.DEV);
  }

  this.enableDebug = function() {
    debugEnabled = true;
  };

  this.initLight = function(){};

  this.init = function(){};

  this.readyLight = function() {};

  this.ready = function() {};

  this.onNavigationBackBrowser = function() {
    if (getWasBackActionPage()) {
      if (!isTrackingActive()) return;
      incrementCount('right navigation');
    }
  };

  this.onNavigationBackEchistory = function() {
    if (this.isTrackablePage()) {
      instance.countBackAction('echistory');
    }
  };

  this.onPageChange = function() {
    if (this.isTrackablePage()) {
      saveWasBackActionPage('page change - trackable');
    } else {
      clearWasBackActionPage('page change - not trackable');
    }
  };

  //Read cookie
  function readCookie() {
    //Session Cookie
    var cookieStr = (functions.getCookieValue(COOKIE_ID) || '___{}').substr(3);
    var cookieData = {count: 0};
    try{ cookieData = JSON.parse(cookieStr); }
    catch(ex){ /* eslint-disable-line no-empty */ }
    cookieData.count = cookieData.count || 0;

    return cookieData;
  }

  //Write cookie
  function writeCookie(fromData, reason){
    var cookieData = {
      count: fromData.count || 0,
      keyword: fromData.keyword || '',
      keyword_id: fromData.keyword_id || '',
      curKeyword: fromData.curKeyword || '',
    };
    if (isVerbose()) console.log('back action count (', cookieData.keyword, ') -', reason, ':', cookieData.count); //eslint-disable-line no-console
    if(window.sessionStorage && sessionStorage.getItem('__ga4_debug')) console.log('Back Cookie - '+JSON.stringify(cookieData)); //eslint-disable-line no-console
    functions.setCookieValue(COOKIE_ID, '___'+JSON.stringify(cookieData), null, '/' );
  }

  function incrementCount(reason, curKeyword) {
    var cookieData = readCookie();
    if (!cookieData.keyword) return;
    cookieData.count = (cookieData.count || 0) + 1;
    if(curKeyword) cookieData.curKeyword = curKeyword;
    writeCookie(cookieData, reason);
    logBackAction(cookieData);
  }

  function clearCount(reason) {
    writeCookie({count: 0}, reason);
  }

  function saveWasBackActionPage(reason) {
    sessionStorage.setItem(WAS_BACK_ACTION_PAGE, '1');
  }

  function clearWasBackActionPage(reason) {
    sessionStorage.removeItem(WAS_BACK_ACTION_PAGE);
  }

  function getWasBackActionPage() {
    return !!sessionStorage.getItem(WAS_BACK_ACTION_PAGE);
  }

  this.isTrackablePage = function() {
    var page = currentPage();
    return page == PAGE_CATEGORY || page == PAGE_SPEC || page == PAGE_RESULTS || page == PAGE_NPNL;
  };

  this.isSeriesPage = function() {
    var page = currentPage();
    return page == PAGE_COMPLEX || page == PAGE_WYSIWYG || page == PAGE_SIMPLE;
  };

  function currentPage() {
    var $body = $('body');

    if ($body.data('spec') && $body.data('spec').match(/\bresults-hawksearch\b/)) return PAGE_RESULTS;

    if ($body.hasClass('category') && !$body.hasClass('makerList')) return PAGE_CATEGORY;

    if ($body.data('init') && $body.data('init').match(/\bspec\b/) && !$body.data('spec').match(/\bresults\b/)) return PAGE_SPEC;

    if ($body.data('init') && $body.data('init').match(/\bnpnl\b/)) return PAGE_NPNL;

    if ($body.data('init') && $body.data('init').match(/\bdetail_complex\b/) && !$body.is('.complexNew')) return PAGE_COMPLEX;

    if ($body.data('init') && $body.data('init').match(/\bdetail_adaptive_complex\b/) && !$body.is('.complexNew')) return PAGE_COMPLEX;

    if ($('[data-wysiwyg]').length && $('[data-wysiwyg-cartbox]').length) return PAGE_WYSIWYG;

    if ($body.data('init') && $body.data('init').match(/\bdetail_simple\b/)) return PAGE_SIMPLE;
  }

  this.peek = function () {
    return readCookie();
  };

  this.keywordChanged = function(keyword, reason) {
    var cookieData = readCookie();
    keyword = (keyword||'').toString().trim().toLowerCase();
    if(cookieData && (keyword == cookieData.curKeyword)) return;
    if (isTrackingActive()) {
      incrementCount(reason || 'count', keyword);
    } else {

      writeCookie({
        count: 0,
        keyword: keyword,
        keyword_id: vonaLight.objects.keyword_tracking.getTempKeywordId(keyword),
        curKeyword: keyword,
      }, reason);
    }
  };

  this.keywordIdAssigned = function(keyword, id) {
    var cookieData = readCookie();
    keyword = (keyword||'').toString().trim().toLowerCase();
    if (!cookieData.keyword_id && (cookieData.keyword == keyword)) {
      cookieData.keyword_id = id;
      writeCookie(cookieData, 'keyword id assigned');
    }
  };

  this.countBackAction = function(reason) {
    if (!isTrackingActive()) return;
    incrementCount(reason || 'count');
  };

  this.resetBackActionTracking = function(reason) {
    clearCount(reason || 'reset');
    clearWasBackActionPage(reason || 'reset');
  };

  // Called from log_seach_performance, which we assume will be loaded on the series page
  // LSP assigns keyword id, so we need to this to occur after the id.
  this.processBackActionTrackingSeriesPage = function() {
    if (this.isSeriesPage()) {
      if (isTrackingActive()) {
        logBackActionSeries(readCookie());
      }
      this.resetBackActionTracking('series page');
    }
  };

  function isTrackingActive(){
    var cookieData = readCookie();
    return !!cookieData.keyword;
  }

  function logBackAction(cookieData){
    vonaLight.functions.ga4SendEvent('BackAction', {
      keyword_id: cookieData.keyword_id,
      keyword: cookieData.keyword.toString().slice(0,100),
      back_action_count: cookieData.count,
    });
  }

  function logBackActionSeries(cookieData){
    vonaLight.functions.ga4SendEvent('BackActionSeries', {
      keyword_id: cookieData.keyword_id,
      keyword: cookieData.keyword.toString().slice(0,100),
      series_code: VNServerInfo.seriesCode,
      back_action_count: cookieData.count,
    });
  }
}
