var keywordSuggestClass = function(functions){
  var PART = { NORMAL: 1, NOLIST: 2, NOCATALOG: 3, CNAVI: 4, DISCON: 5 };
  // These match HS AutocompleteClick event SuggestType parameter
  var HS_KEYWORD_TYPE = { Popular: 1, Categories: 2, Product: 3 };
  var MAX_RESULTS = { Popular: 5, Categories: 5, Product: 10 };
  var state;
  var imeUpdateHandle;
  var keywordRequestPromise;
  var ga4ECommerce;
  var previewActive = false;
