    if( $input.val() ) w = $input.val();
    $input.val( $.trim( w ) );
    updateClearButton();
  }

  // as in rxjs debounce; defer function until no call for specified ms
  function debounceFor(ms, f) {
    var handle;
    return function(v) {
      if (handle) clearTimeout(handle);
      handle = setTimeout(f, ms, v);
    };
  }

  // as in rxjs distinctUntilChanged; only call funtion when input is trivially different
  function withoutDuplicateValues(f) {
    var lastValue;
    return function(v) {
      if (v != lastValue) {
        lastValue = v;
        f(v);
      }
    };
  }

  // ------------------------------ API Requests --------------------------

  function apiGet(url, data) {
    if (!(vonaLight.config && vonaLight.config.api)) throw 'attempt to make api call without retrieving settings';

    var sep = url.indexOf('?') > -1 ? '&' : '?';
    url = vonaLight.config.api.path + url;
    url = url + sep
      + 'lang=' + vonaLight.config.api.lang
      + '&suppressResponseCode=true'
      + '&applicationId='  +vonaLight.config.api.application_id
      + '&_=' + (new Date()).getTime()
    ;

    return functions.requestAjax({
      url: url,
      type: 'GET',
      dataType: 'json',
      contentType: 'application/json; charset=utf-8',
      timeout: 60000,
      data: data,
      error: function(req, err){
        if (err != 'abort') {
          console.log('apiGet error', err, req); //eslint-disable-line no-console
        }
      }
    });
  }

  function receiveKeywords(v){
    var infoflg = v.forwardInfo && v.forwardInfo.keyword;

    state.keyword = { isVisible:!!(v.keywordList||[]).length, list: v.keywordList };
    state.category = { isVisible:!!(v.categoryList||[]).length, list: v.categoryList };
    state.didYouMean = { isVisible:!!(v.didYouMeanList||[]).length, list: v.didYouMeanList };
    state.typeCode = { isVisible: !!infoflg, list: infoflg ? [v.forwardInfo] : [] };

    state.keywordIsLoading = false;
    state.len = getResultCount(state);
    state.selectedIndex = null;
    render(state);
    resetHoverState();
    state.initialKeyword = true; //Needs to be after resetHoverState
    return v;
  }

  function resetHoverState(){
    if(len(state.typeCode)) return notifyActiveElement(0);
    if(len(state.category) || len(state.keyword)) return hover(1);
    if(!state.partNumber || (!state.partNumber.isLoading && (state.len > 0))) return hover(1);
    return notifyActiveElement(0);
  }

  // log debounce
  function makeLogKeywords(q){
    var start = Date.now();
    return function(v) {
      var infoflg = v.forwardInfo && v.forwardInfo.forwardType;
      var end = Date.now();
      var loggable = {
        len : v.keywordList.length + ( infoflg ? 1 : 0 ),
        q: q,
        response_time: end - start
      };
      vonaLight.objects.log_light.suggestKeyword(loggable);
      return v;
    };
  }

  function receivePartNumbers(v){
    var others = [];
    var arr = v.partNumberList||[];
    for (var i = 0;i < arr.length;i++) {
      if (arr[i].partNumberType != PART.DISCON) {
        if(others.length >= MAX_RESULTS.Product) continue;
        others.push(arr[i]);
      }
    }

    state.partNumber = { isLoading: false, isVisible: !!others.length, list: others};

    state.len = getResultCount(state);
    state.selectedIndex = null;
    render(state);
    resetHoverState();
    return v;
  }

  function makeLogPartNumbers(q){
    var start = Date.now();
    return function(v) {
      var end = Date.now();
      var nonpub = [];
      var arr = v.partNumberList||[];
      for (var i = 0;i < arr.length;i++) {
        if (arr[i].partNumberType == PART.NOLIST) {
          nonpub.push(arr[i].partNumber);
        }
      }
      var loggable = {
        len : v.partNumberList.length,
        NonPub_List: nonpub.join(','),
        q: q,
        response_time: end - start
      };
      vonaLight.objects.log_light.suggestPartNumber(loggable);
      return v;
    };
  }

  function apiHawksearchAutocomplete(params) {

    if (!(vonaLight.config && vonaLight.config.api)) throw 'attempt to make api call without retrieving settings';

    var keyword = params.keyword;
    var count = params.count;
    var resultCount = Math.floor(count/2);

    var requestData = {
      ClientGuid: vonaLight.config.api.hawksearch.client_guid,
      Keyword: keyword,
      ProductCount: count,
      Type: 'Category'
    };

    var abortable = functions.requestAjax({
      contentType: 'application/json; charset=utf-8',
      data: JSON.stringify(requestData),
      dataType: 'json',
      timeout: 60000,
      type: 'POST',
      url: vonaLight.config.api.hawksearch.api_base + 'autocomplete',
      error: function(req, err) {
        if (err != 'abort') {
          console.log('apiGet error', err, req); //eslint-disable-line no-console
        }
      }
    });

    var retVal = abortable.then(function(response) {
      var addedKeywords = {};
      var keywords = [];
      var categories = [];
      var categoryCodes = [];
      var didYouMean = [];

      var process = function(keyword) {
        var parts = (keyword || '').split('&raquo;');
        return parts[parts.length - 1]
          .trim()
          .replace(/<\/?b>/g, '');
      };

      var unbold = function(text) {
        return text.replace(/<\/?b>/g, '');
      };

      var extractCategoryCode = function(url) {
        //https://test.hawksearch.net/sites/misumi/_preview/preview.aspx?category=M0802010000
        url = url||'';
        var tag = url.indexOf('category=');
        if(tag < 0) return '';
        var categoryCode = url.slice(tag+9, tag+20);
        if(categoryCode.indexOf('A00000')==0) return '';
        return categoryCode;
      };

      var firstParentSecond = function(parent, child) {
        return child.breadCrumbs.lastIndexOf(parent.breadCrumbs, 0) == 0;
      };

      var tryAddKeyword = function(keyword, type) {
        var keywordLower = keyword.toLowerCase();
        var isDuplicate = addedKeywords[keywordLower];
        if (isDuplicate) return;
        if(keywords.length >= MAX_RESULTS.Popular) return;
        addedKeywords[keywordLower] = true;
        keywords.push({ keyword: keywordLower, type: type });
      };

      var tryAddCategory = function(keyword, categoryCode, breadCrumbs, type) {
        var keywordLower = keyword.toLowerCase();
        var cat = {
          keyword: keywordLower,
          categoryCode: categoryCode,
          breadCrumbs: breadCrumbs,
          type: type
        };

        // In case of two categories with the same name
        // If one category is a child of the other, display only the parent category
        for(var c=0; c<categories.length; c++){
          var old = categories[c];
          if (old.keyword == keywordLower) {
            if (firstParentSecond(old, cat)) {
              return;
            } else if (firstParentSecond(cat, old)) {
              categories.splice(c, 1);
              categoryCodes.splice(c, 1);
              break;
            }
          }
        }

        if(categories.length >= MAX_RESULTS.Categories) return;

        categories.push(cat);
        categoryCodes.push(categoryCode);
      };

      var tryAddDidYouMean = function(keyword, type) {
        var keywordLower = keyword.toLowerCase();
        didYouMean.push({ keyword: keywordLower, type: type });
      };

      // Priority #1
      for(var i=0; i<(response.Popular||[]).length; i++){
        var popular = response.Popular[i];
        tryAddKeyword(process(popular.Value), HS_KEYWORD_TYPE.Popular);
      }

      // Priority #2
      for(var j=0; j<(response.Categories||[]).length; j++){
        var category = response.Categories[j];
        var categoryCode = extractCategoryCode(category.Url);
        if(categoryCode){
          tryAddCategory(process(category.Value), categoryCode, unbold(category.Value), HS_KEYWORD_TYPE.Categories);
        }
      }

      var ksp = window.vona2 && window.vona2.objects && window.vona2.objects.keyword_suggest_preview;
      if (ksp) ksp.currentCategoryList(categoryCodes);

      // Priority #3
      for(var k=0; k<(response.Products||[]).length; k++){
        var product = response.Products[k];
        tryAddKeyword(process(product.ProductName), HS_KEYWORD_TYPE.Product);
      }

      // Priority #4
      for(var l=0; l<(response.DymProductsSearch||[]).length; l++){
        var dym = response.DymProductsSearch[l];
        tryAddDidYouMean(process(dym.Value), HS_KEYWORD_TYPE.Product);
      }

      var hawksearchResult = {
        forwardInfo: undefined,
        keywordList: keywords.slice(0, resultCount),
        categoryList: categories.slice(0, resultCount),
        didYouMeanList: didYouMean.slice(0, 1),
        keyword: keyword
      };

      for (var responseKey in response){
        if (responseKey in response){
          delete response[responseKey];
        }
      }
      for(var resultKey in hawksearchResult){
        response[resultKey] = hawksearchResult[resultKey];
      }
      return response;
    });

    retVal.abort = abortable.abort;
    return retVal;
  }

  function apiGetKeyword(params) {
    if (keywordRequestPromise && keywordRequestPromise.abort) {
      keywordRequestPromise.abort();
    }

    var keyword = params.keyword || '';
    if (keyword.indexOf('#') === 0) {
      keywordRequestPromise = apiGet('keyword/suggest', params);
    } else {
      keywordRequestPromise = apiHawksearchAutocomplete(params);
    }

    keywordRequestPromise
      .then(function(v) {keywordRequestPromise = null; return v;})
      .then(makeLogKeywords(params.keyword))
      .then(receiveKeywords);
  }

  function apiGetPartNumber(params) {
    apiGet('partNumber/suggest', params)
      .then(makeLogPartNumbers(params.keyword))
      .then(receivePartNumbers);
  }
  var apiGetPartNumber420 = debounceFor(420, apiGetPartNumber);

  function trimLeft( s ){ return s.replace(/^\s+/,''); }
  function removeMultiSpace( s ){ return s.replace(/\s+/g, ' '); }

  function performQuery(v){
