  var performQuery80 = debounceFor(80, performQuery);

  // ------------------------------ View --------------------------

  function len( d ){ return d ? (d.list || []).length : 0; }
  function getResultCount(s) {
    return len(s.partNumber) + len(s.category) + len(s.keyword) + len(s.typeCode) + len(s.didYouMean);
  }

  function getInitialState(config){
