  var renderHtmlList = vonaLight.functions.renderHtmlList;

  function getName( e ) {
    var type = e.partNumberType;
    var brand;
    if (e.brandName && e.seriesName) brand = e.brandName + ':' + e.seriesName;
    else if (e.brandName) brand = e.brandName;
    else if (e.seriesName) brand = e.seriesName;
    else brand = '';
    if( type == PART.NORMAL || type == PART.DISCON ) // Standard Part Number,End of sales product.
      return e.partNumber + ( brand ? ' ['+ brand +']' : '' );
    else if( type == PART.NOLIST) {//Product without Information Posted
      return e.partNumber + (brand ? ' ['+ brand +']' : '') + ' ※' + e.partNumberTypeDisp;
    }
    else if( type == PART.NOCATALOG) //Product not Listed in Catalog
      return e.partNumber + ' ['+ brand +' '+ e.partNumberTypeDisp + ']';
    else if( type == PART.CNAVI) // C Navi
      return e.partNumber + ' ['+ brand +' '+ e.partNumberTypeDisp + ']';
  }

  function getUrl( e, s ) {
    var ret = '', type = e.partNumberType, pn = e.partNumber;

    if( type == PART.NOLIST) return '#'; //Product without Information Posted
    else if( type == PART.DISCON ) // End of sales product
      ret = s.vona2_path + '/result/?' + $.param({Keyword: pn});
    else
      ret = s.vona2_path + '/detail/' + e.seriesCode + '/?'
      + $.param({PNSearch: pn, HissuCode: pn, searchFlow: 'suggest2products', Keyword: pn});
    return ret;
  }

  function updateSearchButton(s) {
