        .attr('data-brandname', item.brandName || '')
        .attr('data-seriescode', item.seriesCode || '')
        .text(getName(item));
    });

    var suggestionCount = 0;
    if(s.keyword.list) suggestionCount += s.keyword.list.length;
    if(s.category.list) suggestionCount += s.category.list.length;
    if(s.partNumber.list) suggestionCount += s.partNumber.list.length;
    var screenReaderEl = $content.find('[data-suggestion-count]');
    if(screenReaderEl && screenReaderEl[0]){
      screenReaderEl[0].innerText = suggestionCount == 1 ? suggestionCount + ' suggestion found' : suggestionCount + ' suggestions found';
    }

    updateSearchButton200(s);

    if (ga4ECommerce) ga4ECommerce.contents.partNumberShortcut.init();
  }

  // ------------------------------ Action Support --------------------------

  function keywordSuggestLink($el){
    var key   = $el.attr('data-keyword-suggest')
      , m     = ($el.attr('id')||'').match(/(\d+)/)
      , i     = m && m[0];

    if(! i) return;

    var href = $el.is('[data-partnumbertype=2]') ? undefined : $.trim( $el.attr('href') );

    var o = {
      Select_Q_Num: parseInt(i)+1,
      Select_Q: $el.attr('data-partnumber') || $el.text(),
      q: state.q,
      forwardPageUrl: href ? functions.normalizeURL( href ) : undefined,
      suggestionsCount: $el.closest('ul').find('li').length,
      unPublishedList: $.map( $el.closest('ul').find('li a[data-partnumbertype=2]'), function(e){
        return $(e).data('partnumber');
      }).join(',')
    };

    if (key == 'partNumberLink') {
      var item = state.partNumber.list[i];
      for (var p in item) {
        if (Object.prototype.hasOwnProperty.call(item, p)) {
          o[p] = item[p];
        }
      }
      o.searchType = '2';
    } else {
      o.searchType = '3';
    }

    return vonaLight.objects.log_light.suggestLink( o );
  }

  function checkIsResearch() { return /vona2\/result/.test(document.URL) ? 'isReSearch=1' : ''; }

  //Returns false if navigation canceled
  function navigateTo(el){
    var $el = $( el );

    var logPromise = keywordSuggestLink($el);

    if( state.typeCode.list.length ) { //Part Number match.

      var url  = state.typeCode.list[0].forwardPageUrl;
      return location.href = url;

    } else if( !el ){ // Keyword search

      var params = {
        Keyword: $input.val(),
        isReSearch: checkIsResearch() ? 1 : 0
      };
      var vona2_path = (vonaLight.config && vonaLight.config.ecweb && vonaLight.config.ecweb.catalog_first_directory.path) || '/vona2';

      if(!params.Keyword.trim()) return false;

      if (window.vona2 && vona2.DEV) params.DEV = '1';

      vonaLight.objects.back_action_tracking.keywordChanged(params.Keyword, 'keyword suggest submit');

      functions.transitionPage(
        vona2_path + '/result/',
        [ params ], 
        'GET', 
        '_self'
      );

    } else if( $el.data('partnumbertype') == PART.NOLIST) {// Part Number without Information Posted. 
      vonaLight.loadVona2().then(function() {
        vona2.objects.modal_npp_popup.show({ 
          quantity: 1, partNumber: $el.data('partnumber').toString(),
          brandName:  $el.data('brandname') || '',
          brandCode:  $el.data('brandcode') || ''
        });
      });

    } else {// Transmits normally.

      var href = $el.attr('href');
      var args = [];
      if ( window.vona2 && vona2.DEV ) args.push('DEV=1');
      var research = checkIsResearch();
      if (research) args.push(research);
      if (args.length) {
        if (/\?/.test(href)) href = href + '&' + args.join('&');
        else href = href + '?' + args.join('&');
        $el.attr('href', href);
      }

      /* standard causalilty:
      click (kws)
        KEYWORD_SUGGEST_LINK (kws)
          LOG_POST_START (taskkws)
            wait transition_queue (tasklog)
          log.suggestLink (tasklog)
            log 2 (objects.log)
              LOG_POST_DONE (objects.log)
                release transition_queue (tasklog)
            log 3 (objects.log)
              LOG_POST_DONE (objects.log
                release transition_queue (tasklog)
      */

      if ($el.attr('target') == '_blank') {
        window.open().location.href = href;
      } else {
        logPromise.then(function() {
          location.href = href;
        });
      }
    }
  }

  function incrementalUpdateFocus(i) {
    if( i ){
      var $active = $wrap.find('dd a').eq( i - 1 );
      $input.val( $active.data('partnumber') || $active.text() );
      updateClearButton();
    }
  }

  function setActiveElement( v ){ // Replaces the class which is activated.
    $wrap.find('.is-focus').removeClass('is-focus');
    return (v == 0 || v == null) ? null : $wrap.find('dd a').eq( v-1 ).addClass('is-focus');
  }

  function notifyActiveElement(i) {
    var ksp = window.vona2 && window.vona2.objects && window.vona2.objects.keyword_suggest_preview;
    if (ksp && ksp.isActive()) {
      if (!i) return ksp.selectNothing();
      var $item = $wrap.find('dd a').eq( i-1 );
      if ($item.length) {
        var kind = $item.attr('data-keyword-suggest');
        if (kind == 'keywordLink') {
          var keyword = $item.attr('data-keyword-value');
          ksp.selectKeyword(keyword);
        } else if (kind == 'didYouMeanLink') {
          var keyword2 = $item.attr('data-keyword-value');
          ksp.selectDidYouMean(keyword2);
        } else if (kind == 'categoryLink') {
          var category = $item.attr('data-keyword-category');
          var breadCrumbs = $item.attr('data-keyword-breadcrumbs');
          ksp.selectCategory(category, breadCrumbs);
        } else if (kind == 'partNumberLink') {
          var partNumber = $item.attr('data-partnumber');
          var brandCode = $item.attr('data-brandcode');
          var type = $item.attr('data-partnumbertype');
          if (type == PART.NOLIST) {
            var brandName = $item.attr('data-brandname');
            ksp.selectNPP(partNumber, brandCode, brandName);
          } else {
            var seriesCode = $item.attr('data-seriescode');
            ksp.selectPartNumber(partNumber, seriesCode, brandCode);
          }
        }
      }
    }
  }

  function notifySearchTerm(v) {
    var ksp = window.vona2 && window.vona2.objects && window.vona2.objects.keyword_suggest_preview;
    if (ksp && ksp.isActive()) {
      ksp.setSearchTerm(v);
    }
  }

  function wrapAround(e, l) {
    return ( l == 0 ) ? 0 : (e%l + l) % l; 
  }

  // Paranoia:
  // 1. These get run async (see addEvents)
  // 2. QUnit can run a new test before the async event fires
  // 3. The next test can pull clearTimeout out from under our feet
  // The test should be fixed, but this is extra insurance.
  var imeUpdateRunning = false;

  function imeUpdate() {
    if (!imeUpdateRunning) {
      return;
    }
    searchInput($input.val());
    updateClearButton();
    clearTimeout(imeUpdateHandle);
    imeUpdateHandle = setTimeout(imeUpdate, 300);
  }

  function imeUpdateStart() {
    imeUpdateRunning = true;
    imeUpdate();
  }

  function imeUpdateStop() {
    imeUpdateRunning = false;
    clearTimeout(imeUpdateHandle);
    imeUpdateHandle = null;
  }

  // ------------------------------ Actions --------------------------

  function updateClearButton(){
    if($clearButton) $clearButton.toggleClass('VN_none', !$input.val().length);
  }

  function searchInputExec(v) {
    show(v);
    query(v);
  }
  var searchInput = withoutDuplicateValues(searchInputExec);

  function show(v) {
    //console.log('RESET STATE');
    state = getInitialState(vonaLight.config);
    state.isVisible = !!v;
    state.q = typeof(v) == 'string' ? (v||'') : '';
    state.selectedIndex = null;
    render(state);
    vonaLight.loadVona2({noOverlay: true}).then(function() {
      notifySearchTerm(state.q);
      notifyActiveElement(state.selectedIndex);
    });
  }

  function hide() {
    state.isVisible = false;
    render(state);
    $('body').removeClass('is-searchExpanded');
    vonaLight.functions.dimContent({ hideOverlay: true });
  }

  function hideAndUnfocus() {
    hide();
    if (!$input) $input.blur();
  }

  function focus() {
    if(window.vona2 && vona2.functions && vona2.functions.dispatch) vona2.functions.dispatch('MINIORDERPAD_HIDE')();
    if (state.q) state.isVisible = true;
    render(state);
  }

  function select(delta) {
    if (state.isIME) return;
    if (!state.selectedIndex) {
      state.selectedIndex = 0;
    }
    if(state.initialKeyword){
      state.initialKeyword = false;
      delta = 0;
    }
    state.selectedIndex = wrapAround(state.selectedIndex + delta, state.len + 1);
    incrementalUpdateFocus(state.selectedIndex);
    setActiveElement(state.selectedIndex);
    notifyActiveElement(state.selectedIndex);
  }

  function hover(i){
    state.selectedIndex = i;
    setActiveElement(state.selectedIndex);
    notifyActiveElement(state.selectedIndex);
  }

  function compositionStart(v){
    state.isIME = true;
    imeUpdateStart();
  }

  function compositionEnd(v){
    state.isIME = false;
    imeUpdateStop();
    searchInput(v);
  }

  function query(v){
    if (!v) return;
    performQuery80(v);
  }

  // ------------------------------ Events --------------------------

  function isCode( nums ) {
    if (nums.constructor == Array) {
      return function(e) { return nums.indexOf(e.keyCode) != -1; };
    } else {
      return function(e) { return nums == e.keyCode; };
    }
  }

  function isInputKey( e ) {
    var c = e.keyCode;
    return ( (
      ( 47 < c && c < 112 ) // Alphanumeric character
        || ( c == 173 ) // Firefox's -(hyphenate)
        || ( 185 < c && c < 227 ) // Symbol
    ) && !isCode([91,93])(e) // Alphanumeric character and Hiragana
    ) || isCode([ 8, 32, 45, 46 ])(e); // space bs delete insert
  }

  function addEvents() {
    // During entering IME on IE.
    if( functions.isIE() ) {
      var isInputing = false;
      $input.on('keydown.ks keyup.ks', function(e){
        if( e.type == 'keydown' && e.keyCode == 229 ) {
          isInputing = true;
          setTimeout(compositionStart, 0, getValue());
        }
        if( e.type == 'keyup' && e.keyCode == 13 && isInputing ) {
          isInputing = false;
          setTimeout(compositionEnd, 0, getValue());
        }
        updateClearButton();
      });
    } else {
      // During entering IME on modern brower.
      $input.on('compositionstart.ks', function(e){
        setTimeout(compositionStart, 0, getValue());
      });
      $input.on('compositionend.ks', function(e){
        setTimeout(compositionEnd, 0, getValue());
      });
      updateClearButton();
    }
    // Common with all browser：Entering
    $input.on('keyup.ks input.ks paste.ks', function( e ) {
      setTimeout(function(){
        ( e.type == 'paste' || isInputKey(e) ) && searchInput(getValue());
        updateClearButton();
      }, 0);
    });
    // Escape
    $(document).on('keyup.ks', function( e ){
      if( isCode(27)(e) ) hideAndUnfocus();
      if( isCode(9)(e) ){
        setTimeout(function(){
          if(!$('.VNmodalDim:visible').length) return;
          if($(document.activeElement).closest($wrap).length) return;
          hideAndUnfocus();
        }, 1);
      }
    });
    // Clear
    $clearButton.on('click.ks', function(e) {
      $input.val('').focus();
      updateClearButton();
      searchInput('');
      show('');
    });
    // Transmission
    $('[data-keyword-suggest=form]').on('submit.ks', function( e ){
      e.preventDefault();
      if(state.initialKeyword){
        navigateTo(null);
      }
      else {
        var $focus = $('[data-keyword-suggest=content] li a.is-focus');
        navigateTo($focus.length ? $focus.get(0) : null);
      }
    });
    $wrap.on('click.ks', '.l-header__keywordBox--typeCode a', function(e){
      vonaLight.objects.back_action_tracking.countBackAction('type code link');
      vonaLight.objects.keyword_tracking.resetSearchKeyword();
    });
    $wrap.on('click.ks', 'a[data-keyword-suggest=partNumberLink], a[data-keyword-suggest=keywordLink], a[data-keyword-suggest=categoryLink], a[data-keyword-suggest=keywordLink], a[data-keyword-suggest=didYouMeanLink]', function(e){

      e.preventDefault();

      if (($(this).is('a[data-keyword-suggest=partNumberLink]')) && $(this).is('[data-ga-e-commerce="target"]')) {
        if (ga4ECommerce) ga4ECommerce.contents.partNumberShortcut.sendSelectedElement($(this), e);
      }

      var $el = $(e.currentTarget);
      var kind = $el.attr('data-keyword-suggest');
      if(kind === 'keywordLink' || kind === 'categoryLink' || kind === 'didYouMeanLink'){
        var value = $el.attr('data-keyword-value');
        vonaLight.objects.log_hs_analytics.logAutocomplete(state.q, value, $el.attr('href'), $el.attr('data-keyword-type'));
        vonaLight.objects.back_action_tracking.keywordChanged(value, 'keyword suggest link keyword');
      } else {
        vonaLight.objects.back_action_tracking.countBackAction('keyword suggest link');
      }

      this.target = (e.ctrlKey && !e.metaKey) || (!e.ctrlKey && e.metaKey) ? '_blank' : '_self';

      var tag = '';
      if (kind == 'keywordLink') tag = 'keyword:'+$el.attr('data-keyword-value');
      else if (kind == 'categoryLink') tag = 'category:'+$el.attr('data-keyword-category');
      else if (kind == 'partNumberLink') tag = 'part:'+$el.attr('data-partnumber');
      else if (kind == 'didYouMeanLink') tag = 'didyoumean:'+$el.attr('data-keyword-value');

      var el = this;
      vonaLight.functions.ga4SendEvent('LinkClick', {
        e_action: 'KeywordSuggest',
        e_search_keyword: getValue(),
        tag: tag,
      }, function() {
        setTimeout(navigateTo, 250, el);
      });

      vonaLight.objects.keyword_tracking.resetSearchKeyword();
    });
    // Clicking outside of the element.
    $(document).on('click', function(e){
      if($('body').hasClass('is-modal')) return;
      if(e && e.target && $(e.target).closest('.tooltipMessage').length) return;
      hide();
    });
    $wrap.on('click.ks', '[data-btn=keyword-suggest-preview-cart]', function(){
      if(!$('body').hasClass('is-modal')) hide();
    }); // remove the dimContent status, which applies styles that mangle the add to cart dialog.
    $wrap.on('click.ks', function(e) { e.stopPropagation(); });
    // Focus
    $input.on('focus', function( e ) {
      if(getValue()) searchInput(getValue());
      updateClearButton();
      $(this).select();
      focus();
      $('body').addClass('is-searchExpanded');
      vonaLight.functions.dimContent({ onHide: function(){ $('body').removeClass('is-searchExpanded'); } });
    });
    // Up and down keys
    $input.on('keyup.ks', function(e){
      $('body').addClass('is-searchExpanded');
      vonaLight.functions.dimContent({ onHide: function(){ $('body').removeClass('is-searchExpanded'); } });
      if( state.isIME ) return;
      if( isCode(38)( e ) ) select( -1 );
      if( isCode(40)( e ) ) select( 1 );
    });
    // Hover which is candidate of suggest.
    $wrap.on('mouseenter.ks', 'dd a', function(e){
      hover( $wrap.find('dd a').index(this)+1 );
    });
    $(window).on('resize.ks', function(e){
      var ksp = window.vona2 && window.vona2.objects && window.vona2.objects.keyword_suggest_preview;
      var active = ksp && ksp.isActive();
      if (active && !previewActive) {
        notifyActiveElement(state.selectedIndex);
      }
      previewActive = active;
    });

    function getValue() { return $input.val(); }
  }

