  }

  function extend(dest) {
    for (var i = 1; i < arguments.length; i++) {
      var obj = arguments[i];
      for (var prop in obj) {
        dest[prop] = obj[prop];
      }
    }

    return dest;
  }

  function isEmpty(array) {
    if (array.length < 1) return true;
    for (var i in array) {
      if (array[i]) return false;
    }
    return true;
  }

  function buildUrl(url, params) {
    if (window.vona2 && vona2.functions && vona2.functions.buildUrl) {
      return vona2.functions.buildUrl(url, params);
    } else if (window.vonaLight_Spec && vonaLight_Spec.functions && vonaLight_Spec.functions.buildUrl) {
