  /**
   * function equivilent to chunk in Underscore.js
   * https://underscorejs.org/#chunk
   * @param {[]} array
   * @param {number} count
   */
  function chunk(array, count) {
    if (count == null || count < 1) return [];
    var result = [];
    var i = 0,
      length = array.length;
    while (i < length) {
      result.push(Array.prototype.slice.call(array, i, (i += count)));
    }
    return result;
  }

  /**
   * simplified version of uniq in Underscore.js
   * https://underscorejs.org/#uniq
   * @param {[]} array
   * @param {function} iteratee
   */
  function uniq(array, iteratee) {
    var result = [];
    var seen = [];
    for (var i = 0, length = array.length; i < length; i++) {
      var value = array[i],
        computed = iteratee(value, i, array);
      if (seen.indexOf(computed) < 0) {
        seen.push(computed);
        result.push(value);
      }
    }
    return result;
  }

  /**
