  /**
   * Send a view_item_list event with the specified parts
   * @param {string} content page area
   * @param {string} list list parts contained in
   * @param {part[]} parts object with common/generic fields
   */
  function sendViewedParts(content, list, parts) {
    sendViewItemList(
      parts
        .map(function (part) {
          var item = {
            item_id: part.seriesCode || '',
            item_list_name: list || '',
          };
          if (part.innerCode) item.item_variant = part.innerCode;
          if (part.partNumber) item.item_name = part.partNumber;
          return item;
        }),
      content
    );
  }

  this.sendViewedParts = sendViewedParts;

  /**
   * Generate measurement data and send Product Impressions only once
   * @param {string} content page area
   * @param {string} uniqKey A key to determine whether it has already been sent (model number or series code
   * @param {Object} params
   * @param {jQuery} params.$target links to measure
   * @param {string} params.list list links contained in
   */
  function sendViewedElementsOnce(content, uniqKey, params) {
    var dataAttributes = [];
    var sentList;
    switch (uniqKey) {
      case HISTORY_KEY.SERIES_CODE:
        dataAttributes = ['data-seriescode'];
        sentList = instance.contents[content].sentSeriesCodeList;
        break;
      case HISTORY_KEY.PART_NUMBER:
        dataAttributes = ['data-partNumber'];
        sentList = instance.contents[content].sentPartNumberList;
        break;
      case HISTORY_KEY.SERIES_CODE_PART_NUMBER:
        dataAttributes = ['data-seriescode', 'data-partNumber'];
        sentList = instance.contents[content].sentSeriesCodePartNumberList;
        break;
    }

    var inList = {};
    var filteredTargets = params.$targets.toArray()
      // remove sent links
      .filter(function (el) {
        var sentData = getDataAttributeValue(el, dataAttributes);
        var dup = inList[sentData];
        inList[sentData] = true;
        return !dup && sentList.indexOf(sentData) == -1;
      });
    params.$targets = $(filteredTargets);
    var hasSent = !params.$targets.length;

    if (hasSent) {
      return;
    }

    sendViewedElements(content, params);

    var newSentList = params.$targets
      .map(function () {
        return getDataAttributeValue(this, dataAttributes);
      })
      .toArray();
    switch (uniqKey) {
      case HISTORY_KEY.SERIES_CODE:
        instance.contents[content].sentSeriesCodeList = instance.contents[
          content
        ].sentSeriesCodeList.concat(newSentList);
        break;
      case HISTORY_KEY.PART_NUMBER:
        instance.contents[content].sentPartNumberList = instance.contents[
          content
        ].sentPartNumberList.concat(newSentList);
        break;
      case HISTORY_KEY.SERIES_CODE_PART_NUMBER:
        instance.contents[content].sentSeriesCodePartNumberList = instance.contents[
          content
        ].sentSeriesCodePartNumberList.concat(newSentList);
        break;
    }
  }

  /**
   * Generate measurement data and send Product Impressions without sending the exact same list twice in a row
   * @param {string} content page area
   * @param {string} uniqKey A key to determine whether it has already been sent (model number or series code
   * @param {Object} params
   * @param {jQuery} params.$target links to measure
   * @param {string} params.list list links contained in
   */
  function sendViewedElementsWithoutRepeat(content, uniqKey, params) {
    var dataAttributes = [];
    var sentList;
    switch (uniqKey) {
      case HISTORY_KEY.SERIES_CODE:
        dataAttributes = ['data-seriescode'];
        sentList = instance.contents[content].sentSeriesCodeList;
        break;
      case HISTORY_KEY.PART_NUMBER:
        dataAttributes = ['data-partNumber'];
        sentList = instance.contents[content].sentPartNumberList;
        break;
      case HISTORY_KEY.SERIES_CODE_PART_NUMBER:
        dataAttributes = ['data-seriescode', 'data-partNumber'];
        sentList = instance.contents[content].sentSeriesCodePartNumberList;
        break;
    }

    var plainTargets = params.$targets.toArray();
    if (sentList.length == plainTargets.length) {
      var hasSent = true;
      var sentListSorted = sentList.slice().sort();
      var plainTargetsSorted = [];
      for(var j = 0; j<plainTargets.length; j++){ plainTargetsSorted.push(getDataAttributeValue(plainTargets[j], dataAttributes)); }
      plainTargetsSorted.sort();

      for (var i = 0; i<plainTargetsSorted.length; i++) {
        if (sentListSorted[i] != plainTargetsSorted[i]) {
          hasSent = false;
          break;
        }
      }

      if (hasSent) {
        return;
      }
    }

    sendViewedElements(content, params);

    var newSentList = params.$targets
      .map(function () {
        return getDataAttributeValue(this, dataAttributes);
      })
      .toArray();
    switch (uniqKey) {
      case HISTORY_KEY.SERIES_CODE:
        instance.contents[content].sentSeriesCodeList = newSentList;
        break;
      case HISTORY_KEY.PART_NUMBER:
        instance.contents[content].sentPartNumberList = newSentList;
        break;
      case HISTORY_KEY.SERIES_CODE_PART_NUMBER:
        instance.contents[content].sentSeriesCodePartNumberList = newSentList;
        break;
    }
  }

  /**
   * Get data attribute values, combine and return
   * @param {HTMLElement} el the element to get the attribute from
   * @param {string[]} dataAttributes attribute name
   * @returns {string}
   */
  function getDataAttributeValue(el, dataAttributes) {
    return dataAttributes
      .map(function (dataAttribute) {
        return $(el).attr(dataAttribute);
      })
      .join('');
  }

  /**
   * closure some arguments for viewed elements
