    var newProduct = extend({item_list_name: list || getListForProductAddToCart()}, product);

    var data = {
      event: 'view_item',
      ucd: userInfo().userCode || '',
      cust: userInfo().customerCode || '',
      u_language: language(),
      currency: currency(),
      value : '0',
      ecommerce: {
        items: [newProduct]
      }
    };

    if (isVerbose()) {
      console.log('View Item dataLayer.push', extend({}, data)); //eslint-disable-line no-console
    }

    window.dataLayer = window.dataLayer || [];
    window.dataLayer.push({ecommerce: null});
    window.dataLayer.push(data);
