  /**
   * Add to Cart
   * @param {Object[]} products
   * @param {string|undefined} add_to_cart_type where the cart is located
   * @param {string|undefined} list
   */
  function sendAddToCart(products, add_to_cart_type, list) {
    if (isEmpty(products)) {
      return;
    }

    var newProducts = products.map(function (product) {
      return extend({item_list_name: list || getListForProductAddToCart()}, product);
    });

    chunk(newProducts, ITEM_LIMIT).forEach(function(batch) {
      var data = {
        event: 'add_to_cart',
        ucd: userInfo().userCode || '',
        cust: userInfo().customerCode || '',
        u_language: language(),
        currency: currency(),
        value : '0',
        e_add_to_cart_type: add_to_cart_type,
        ecommerce: {
          items: batch
        }
      };

      if (isVerbose()) {
        console.log('Add to Cart dataLayer.push', extend({}, data)); //eslint-disable-line no-console
      }

      window.dataLayer = window.dataLayer || [];
      window.dataLayer.push({ecommerce: null});
      window.dataLayer.push(data);
    });
  }

  /**
   * Actually send view_item_list to GA4
   * @param {Object[]} items formatted for GA4
   * @param {string} content Measurement area (not required as it is used to output logs)
   */
  function sendViewItemList(items, content) {
    if (isEmpty(items)) {
      if (isVerbose()) {
        console.log('no items to send'); //eslint-disable-line no-console
      }
      return;
    }

    var newItems = uniq(items.map(function (item) {
      return extend({}, item);
    }), function(item) {return item.item_id+item.item_list_name;});

    chunk(newItems, ITEM_LIMIT).forEach(function(batch) {
      var data = {
        event: 'view_item_list',
        ucd: userInfo().userCode || '',
        cust: userInfo().customerCode || '',
        u_language: language(),
        ecommerce: {
          items: batch
        }
      };

      if (isVerbose()) {
        console.log( //eslint-disable-line no-console
          'view_item_list dataLayer.push',
          '\nlist: ' + items[0].item_list_name,
          '\ncontent: ' + (content || 'unknown'),
          extend({}, data)
        );
      }

      window.dataLayer = window.dataLayer || [];
      window.dataLayer.push({ecommerce: null});
      window.dataLayer.push(data);
    });
  }

  /**
   * send select_item to GA4
   * @param {Object} item
   * @param {string} list list item contained in
   * @param {Object} options
   * @param {Event} options.event the event object of the link being instrumented

   * @param {boolean} options.isBlank Whether the target of the instrumented link is blank
   * @param {string} options.targetUrl URL of the link
   * @param {string} content Measurement area (not required as it is used to output logs)
   */
  function sendSelectItem(item, list, options, content) {
    // GTM is not working, processing is interrupted because it is not possible to transition to the linked URL after measurement
    if (!window.google_tag_manager) {
      return;
    }

    if (!item) {
      return;
    }

    var newItem = extend({}, item);
    delete newItem.list;
    var data = {
      event: 'select_item',
      ucd: userInfo().userCode || '',
      cust: userInfo().customerCode || '',
      u_language: language(),
      ecommerce: {
        items: [newItem]
      }
    };
    // keyword suggest also navigates directly, and may override us. In that case, we assume the list based on the searchFlow paramter
    var targetUrl =
      options.targetUrl && options.targetUrl !== '#'
        ? buildUrl(options.targetUrl, [{ list: list }])
        : '';

    options.event.preventDefault();

    if (options.isBlank) {
      if (!targetUrl) {
        return;
      }

      window.open().location.href = targetUrl;
    } else {
      options.$target.attr('data-sending-ga-e-commerce', '1');
      data = extend(data, {
        eventCallback: function () {
          options.$target.removeAttr('data-sending-ga-e-commerce');

          if (!targetUrl) {
            return;
          }

          if (options.$target.attr('data-sending-log')) {
            options.$target.attr('href', targetUrl);
          } else {
            options.$target.attr('href', targetUrl);
            document.location = targetUrl;
          }
        },
        eventTimeout: 3000
      });
    }

    if (isVerbose()) {
      console.log( //eslint-disable-line no-console
        'select item dataLayer.push',
        '\nlist: ' + list,
        '\ncontent: ' + (content || 'unknown'),
        extend({}, data),
        newItem
      );
    }

    window.dataLayer = window.dataLayer || [];
    window.dataLayer.push({ecommerce: null});
    window.dataLayer.push(data);
  }
};
