var logLightClass = function(functions){
  var instance;

  this.initLight = function(){
    instance = this;
  };
  this.enabled = true;

  this.init = function(){};
  this.ready = function(){};

  // as in rxjs debounce; defer function until no call for specified ms
  function debounceFor(ms, f) {
    var handle;
    return function(v) {
      if (handle) clearTimeout(handle);
      handle = setTimeout(f, ms, v);
    };
  }

  function apiPost(url, data) {
    if (!(vonaLight.config && vonaLight.config.api)) throw 'attempt to make api call without retrieving settings';

    var sep = url.indexOf('?') > -1 ? '&' : '?';
    url = vonaLight.config.api.path + url;
    url = url + sep
      + 'lang=' + vonaLight.config.api.lang
      + '&suppressResponseCode=true'
      + '&applicationId='  +vonaLight.config.api.application_id
      + '&_=' + (new Date()).getTime()
    ;

    return functions.requestAjax({
      url: url,
      type: 'POST',
      dataType: 'json',
      contentType: 'application/json; charset=utf-8',
      timeout: 60000,
      data: JSON.stringify( data ),
      error: function(req, err){
        if (err != 'abort') {
          console.log('apiPost error', err, req); //eslint-disable-line no-console
        }
      }
    });
  }

  function track(data) { // Log transmission
    if(!instance.enabled) return;

    data.cookieId = functions.getCookieValue('VONA_COMMON_LOG_KEY');

    var type = parseInt( data.logType ), url = 'log/add?logType=' + type;
    return apiPost( url, { message: data } );
  }

  function getSuggestLinkParam( data, logType ) {
    return {
      logType: logType.toString(),
      keyword: data.q,
      url: functions.normalizeURL( location.href ),
      searchResultType : 'Link',
      userInput        : logType == 2 ? undefined : data.q,
      searchType       : data.searchType,
      seriesCode       : data.seriesCode,
      brandCode        : data.brandCode,
      selectedKeyword  : data.Select_Q,
      selectedKeywordDispNo : logType == 2 ? undefined : data.Select_Q_Num,
      forwardPageUrl : data.forwardPageUrl,
      forwardPageUrlDispNo : logType == 2 ? undefined : data.Select_Q_Num,
      suggestionsCount : data.suggestionsCount,
      unPublishedList : ( logType == 2 || data.searchType == 3 ) ? undefined:data.unPublishedList,
    };
  }

  this.suggestLink = function( d ) {
    return $.when(
      track(getSuggestLinkParam( d, 2 )),
      track(getSuggestLinkParam( d, 3 ))
    );
  };

  function getSuggestParam( data, logType, searchType ) {
    //console.log(data,"raw")
    return {
      logType: logType.toString(),
      userInput: logType == 2 ? undefined : data.q,
      keyword: data.q,
      searchResultType: data.len > 0 ? 'Hit' : 'NotFound',
      suggestionsCount: data.len,
      unpublishedList: logType == 2 ? undefined : data.NonPub_List,
      responseTime: logType == 2 ? undefined : data.response_time ,
      url: functions.normalizeURL( location.href ),
      searchType: searchType.toString(),
    };
  }

  function suggestKeyword( d ) {
    track(getSuggestParam( d, 2, 3 ));
    track(getSuggestParam( d, 3, 3 ));
  }
  this.suggestKeyword = debounceFor(3000, suggestKeyword);

  function suggestPartNumber( d ) {
    track(getSuggestParam( d, 2, 2 ));
    track(getSuggestParam( d, 3, 2 ));
  }
  this.suggestPartNumber = debounceFor(3000, suggestPartNumber);
};
/* JS for Search Performance Reporting */
var logSearchPerformanceQueryClass = function(){
  var CATEGORY_SEARCH_PERFORMANCE = 'SearchPerformance';
  var ACTION_SEARCH_QUERY = 'SearchQuery';
  var ACTION_SEARCH_RESULT_CLICK = 'SearchResultClick';

  var instance = this;
  var readied = false;

  this.readyLight = function() {
    if (readied) return;

    vonaLight.waitForVonaLightReady(function(){
      instance.processSearchQuery();
      instance.processSearchResultClick();

      vonaLight.objects.back_action_tracking.processBackActionTrackingSeriesPage(); // must be after processSearchQuery
    });

    readied = true;
  };

  function getKeyword(){
    return vonaLight.objects.keyword_tracking.getKeyword();
  }

  function getKeywordID(){
    return vonaLight.objects.keyword_tracking.getKeywordID();
  }

  function getLastSearchResultClickID(){
    return vonaLight.objects.keyword_tracking.getLastSearchResultClickID();
  }

  function isResultsActive() {
    return ($('body').attr('data-spec') == 'results-hawksearch' );
  }

  this.processSearchQuery = function() {
    var keywordParam = vonaLight.functions.getURLParamValue('Keyword') || vonaLight.functions.getURLParamValue('KWSearch') || vonaLight.functions.getURLParamValue('categoryKeyword');
    if(isResultsActive() && window.VNServerInfo){
      logSearchQuery(VNServerInfo.keyword);
    } else if(keywordParam && keywordParam != ''){
      logSearchQuery(keywordParam);
    }
  };

  this.processSearchResultClick = function() {
    var infoUa;
    var infoGa4;
    if(getKeyword()){
      window.VNServerInfo = window.VNServerInfo || {};
      switch(vonaLight.functions.getURLParamValue('searchFlow')){
        case 'suggest2products': // type partial part number into box, click part in dropdown: 500
          infoUa = buildProductInfoUa('ProductSuggest');
          infoGa4 = buildProductInfoGa4('ProductSuggest');
          logSearchResultClick(infoUa, infoGa4);
          break;
        case 'results2products': // click a Products on results page
          infoUa = buildProductInfoUa('Product');
          infoGa4 = buildProductInfoGa4('Product');
          logSearchResultClick(infoUa, infoGa4);
          break;
        case 'results2category': // click a Categories on results page
          infoUa = buildCategoryinfoUa('Category');
          infoGa4 = buildCategoryInfoGa4('Category');
          logSearchResultClick(infoUa, infoGa4);
          break;
        case 'results2type': // search for full or partial part number: lmu3 or sfj6-100 or sjf
          infoUa = buildProductInfoUa('Type');
          infoGa4 = buildProductInfoGa4('Type');
          logSearchResultClick(infoUa, infoGa4);
          break;
        case 'results2maker': // search for brand: Misumi
          infoUa = buildBrandinfoUa('Brand');
          infoGa4 = buildBrandInfoGa4('Brand');
          logSearchResultClick(infoUa, infoGa4);
          break;
        case 'results2similartn': // search term thats sort of like a part number, click suggestion on results page: cbsst-3-4-5
          infoUa = buildProductInfoUa('ProductAlternate');
          infoGa4 = buildProductInfoGa4('ProductAlternate');
          logSearchResultClick(infoUa, infoGa4);
          break;
      }
    }
  };

  function buildProductInfoUa(tag){
    var label = tag + '&' +
      getKeywordID() + '&#&' +
      encodeURIComponent(getKeyword()) + '&' +
      encodeURIComponent(VNServerInfo.categoryCode||'') + '&' +
      encodeURIComponent(VNServerInfo.categoryName||'') + '&' +
      encodeURIComponent(VNServerInfo.seriesCode||'') + '&';
    if(VNServerInfo.fixedInfo){
      label += encodeURIComponent(VNServerInfo.fixedInfo);
    } else if(VNServerInfo.partNumberList && VNServerInfo.partNumberList.length && VNServerInfo.partNumberList[0]){
      if(VNServerInfo.partNumberList[0].partNumber){
        label += encodeURIComponent(VNServerInfo.partNumberList[0].partNumber);
      }
    }
    return label;
  }

  function buildProductInfoGa4(tag){
    var ga4 = {
      tag: tag,
      keyword_id: getKeywordID(),
      keyword: getKeyword(),
      category_code: VNServerInfo.categoryCode||'',
      category_name: VNServerInfo.categoryName||'',
      series_code: VNServerInfo.seriesCode||'',
    };
    if(VNServerInfo.fixedInfo){
      ga4.fixed_info = VNServerInfo.fixedInfo;
    } else if(VNServerInfo.partNumberList && VNServerInfo.partNumberList.length && VNServerInfo.partNumberList[0]){
      if(VNServerInfo.partNumberList[0].partNumber){
        ga4.part = VNServerInfo.partNumberList[0].partNumber;
      }
    }
    return ga4;
  }

  function buildCategoryinfoUa(tag){
    var label = tag + '&' +
      getKeywordID() + '&#&' +
      encodeURIComponent(getKeyword()) + '&' +
      encodeURIComponent(VNServerInfo.categoryCode||'') + '&' +
      encodeURIComponent(VNServerInfo.categoryName||'') + '&' +
      encodeURIComponent(VNServerInfo.brandCode||'');
    return label;
  }

  function buildCategoryInfoGa4(tag){
    var ga4 = {
      tag: tag,
      keyword_id: getKeywordID(),
      keyword: getKeyword(),
      category_code: VNServerInfo.categoryCode||'',
      category_name: VNServerInfo.categoryName||'',
      brand_code: VNServerInfo.brandCode||'',
    };
    return ga4;
  }

  function buildBrandinfoUa(tag){
    var label = tag + '&' +
      getKeywordID() + '&#&' +
      encodeURIComponent(getKeyword()) + '&' +
      encodeURIComponent('') + '&' +
      encodeURIComponent('') + '&' +
      encodeURIComponent(VNServerInfo.brandCode||'');
    return label;
  }

  function buildBrandInfoGa4(tag){
    var ga4 = {
      tag: tag,
      keyword_id: getKeywordID(),
      keyword: getKeyword(),
      brand_code: VNServerInfo.brandCode||'',
    };
    return ga4;
  }

  function logSearchQuery(newKeyword){
    newKeyword = (newKeyword || '').trim().toLowerCase();
    var pageLayout = ((window.VNServerInfo && VNServerInfo.pageLayout) || '');
    if(pageLayout.substr(0,7)=='Series.'){
      var getParams = vonaLight.functions.parseQuerystring(window.location.search);
      if(getParams && (getParams.searchFlow=='results2type')) pageLayout = 'Part';
      else pageLayout = 'Series';
    }
    //Log only if the keyword changed
    vonaLight.objects.keyword_tracking.ifKeywordChanged(newKeyword, function() {
      vonaLight.functions.gaSendEvent(
        CATEGORY_SEARCH_PERFORMANCE,
        ACTION_SEARCH_QUERY,
        getKeywordID() + '&' + encodeURIComponent(getKeyword()),
        1,
        {nonInteraction: true}
      );
      vonaLight.functions.ga4SendEvent(ACTION_SEARCH_QUERY, {
        action: pageLayout,
        keyword_id: getKeywordID(),
        keyword: getKeyword(),
      });
    });
  }

  function logSearchResultClick(infoUa, infoGa4){
    //Log only if it's not the same page
    vonaLight.objects.keyword_tracking.ifSearchResultClickChanged(infoUa, function() {
      var lastSearchResultClickID = getLastSearchResultClickID();
      var timestamp = Date.now().toString();
      var idLabel = infoUa.replace('&#&', '&'+lastSearchResultClickID+'&' + timestamp + '&');
      infoGa4.click_id = lastSearchResultClickID;
      infoGa4.timestamp = timestamp;

      vonaLight.functions.gaSendEvent(
        CATEGORY_SEARCH_PERFORMANCE,
        ACTION_SEARCH_RESULT_CLICK,
        idLabel,
        1,
        {nonInteraction: true}
      );
      vonaLight.functions.ga4SendEvent(ACTION_SEARCH_RESULT_CLICK, infoGa4);

    });
  }
};
