/* JS for Country notice (e.g. country/region selection) */
var noticeCountryClass = function(){
  var _this = this;

  this.render = function() {
    if(_this.isActive()) {
      $('.m-notice-country').show();
      $('.m-notice-country__button_close').off('click.country_selection').on('click.country_selection', function(){
        $('.m-notice-country').hide();
        localStorage.setItem('notice_country_closed', Date.now());
      });
    }
  };

  this.isActive = function(){
    if(!$('.m-notice-country').length) return false;
    if(!('notice_country_closed' in localStorage)) return true;
    var lastClosed = parseInt(localStorage.getItem('notice_country_closed'));
    if(!lastClosed) return true;
    var timeElapsed = Date.now() - lastClosed;
    if(Math.round(timeElapsed / (1000 * 3600 * 24)) >= 90) return true;
    return false;
  };
};
