var Carousel = (function() {
  var Carousel = function($self, resource) {
    var presenter = this;

    presenter.$self = $self;
    presenter.resource = resource;
    presenter.loading = false;
    var $list = $self.find('[data-carousel]');
    presenter.item_template_raw = $list.data('show-more-template');

    if( $list.length > 0 && $list.slick ){
      presenter.slick($list, 0);
    }
  };

  Carousel.prototype.slick = function($list, initialSlide) {
    var presenter = this;
    $list.slick({
      initialSlide: initialSlide,
      slidesToShow: 1,
      slidesToScroll: 1,
      infinite: false,
      speed: 200,
      mobileFirst: true,
      responsive: [
        {
          breakpoint: 1600,
          settings: {
            slidesToShow: 5,
            slidesToScroll: 5,
            dots: true
          }
        },
        {
          breakpoint: 1300,
          settings: {
            slidesToShow: 4,
            slidesToScroll: 4,
            dots: true
          }
        },
        {
          breakpoint: 950,
          settings: {
            slidesToShow: 3,
            slidesToScroll: 3,
            dots: true
          }
        },
        {
          breakpoint: 600,
          settings: {
            slidesToShow: 2,
            slidesToScroll: 2,
            dots: true
          }
        },
        {
          breakpoint: 1,
          settings: {
            slidesToShow: 1,
            slidesToScroll: 1,
            dots: true
          }
        }
      ]
    }).on('afterChange', function(event, slick, currentSlide) {
      var nextVisible = currentSlide + slick.breakpointSettings[slick.activeBreakpoint].slidesToShow * 2;
      if (nextVisible > slick.slideCount) {
        vonaLight.loadVona2().then(function() {presenter.loadMore();});
      }
    });
  };

  Carousel.prototype.loadMore = function() {
    var presenter = this;
    if (presenter.loading) return;
    if (!this.resource.moreDataAvailable()) return;

    presenter.loading = true;
    this.resource.nextPage()
      .then(function(response) {presenter.renderMore(response);})
      .always(function() {presenter.loading = false;});
  };

  Carousel.prototype.renderMore = function(seriesList) {
    var presenter = this;
    if (!presenter.item_template_twig) {
      presenter.item_template_twig = vona2.functions.initTwig(presenter.item_template_raw);
    }
    var newItems = _.map(seriesList, function(context) {
      return presenter.item_template_twig.render(context);
    });
    var $self = presenter.$self;
    var $slider = $self.find('[data-carousel]');
    // slickAdd is extraordinarily slow, "freeze the UI for several seconds" slow.
    // tearing it down and reinitializing is actually better.
    var current = $slider.slick('slickCurrentSlide');
    $slider.slick('unslick');
    $slider.append(newItems);
    presenter.slick($slider, current);
  };

  return Carousel;
})()
