      requestIdleCallback(f);
    } else {
      setTimeout(f, 0);
    }
  };

  vonaLight.eachSeries = function(arr, f, onComplete, startIdx){
    if(!onComplete) onComplete = function(){};
    if(!arr) return onComplete();
    if(!startIdx) startIdx = 0;
    if(startIdx >= arr.length) return onComplete();
    f(arr[startIdx], startIdx, function(){
      vonaLight.eachSeries(arr, f, onComplete, startIdx+1);
    });
  }

  vonaLight.eachOfSeries = function(arr, f, onComplete, startIdx){
    if(!arr) return onComplete();
    var keys = [];
    for(var key in arr) keys.push(key);
    vonaLight.eachSeries(keys, function(val, idx, cb){ f(arr[val], val, cb); }, onComplete, startIdx);
  }

  vonaLight.eachParallel = function(arr, f, onComplete){
    if(!onComplete) onComplete = function(){};
    if(!arr) return onComplete();

    var done = [];
    for(var i=0;i<arr.length;i++) done[i] = false;
    var allDone = false;

    function checkAllDone(){
      if(allDone) return true;
      var hasRemaining = false;
      for(var i=0;i<done.length;i++){
        if(!done[i]) hasRemaining = true;
      }
      if(!hasRemaining){
        allDone = true;
        onComplete();
        return true;
      }
      return false;
    }

    if(checkAllDone()) return;

    for(var i=0;i<arr.length;i++){
      (function(){
        var idx = i;
        f(arr[idx], idx, function(){
          done[idx] = true;
          checkAllDone();
        });
      })();
    }
  }

  vonaLight.eachOfParallel = function(arr, f, onComplete){
    if(!arr) return onComplete();
    var keys = [];
    for(var key in arr) keys.push(key);
    vonaLight.eachParallel(keys, function(val, idx, cb){ f(arr[val], val, cb); }, onComplete);
  }

  vonaLight.controllers = {
    Carousel: Carousel,
    CategoryListing: CategoryListing,
    ItemList: ItemList,
    PartNumberListing: PartNumberListing,
    SeriesListing: SeriesListing,
