  var loadAfterTick = function(){
    vonaLight.eachOfParallel(vonaLight.objects, function(obj, objName, cb_init){
      if(!obj.initLight) return cb_init();
      setTimeout(function(){ obj.initLight(); cb_init(); }, 0);
    }, function(){
      vonaLight.eachOfParallel(vonaLight.objects, function(obj, objName, cb_ready){
        if(!obj.readyLight) return cb_ready();
        setTimeout(function(){ obj.readyLight(); cb_ready(); }, 0);
      }, function(){
        window.VNLightIsReady = true;
        if(window.VNLightOnReady){
          for(var i=0;i<window.VNLightOnReady.length;i++) delayTick(window.VNLightOnReady[i]);
        }
      });
    });
  }
  delayTick(function(){
    loadAfterTick();
  });

  var loadSeriesLazyScripts = function(callback){
    if(!callback) callback = function(){};
    var lazyScripts = $('.lazyscript');
    vonaLight.eachSeries(lazyScripts, function(el, idx, cb){
      var $el = $(el);
      $el.on('load', cb);
      $el.on('error', function() {
        console.error('lazy script load failed', $el.attr('src'));
        cb();
      });
      $el.removeClass('lazyscript');
      $el.attr('src', $el.data('src'));
    }, callback);
  };
  //Emulate slow load
  //var orig_loadSeriesLazyScripts = loadSeriesLazyScripts; loadSeriesLazyScripts = function(callback){ setTimeout(function(){ orig_loadSeriesLazyScripts(callback); }, 15000); };

  var loadParallelLazyScripts = function(callback){
    if(!callback) callback = function(){};
    var lazyScripts = $('.lazyscript');

    vonaLight.eachParallel(lazyScripts, function(el, idx, cb){
      var $el = $(el);
      $el.on('load', cb);
      $el.removeClass('lazyscript');
      $el.attr('src', $el.data('src'));
    }, callback);
  }

  var reclick = function(sel, options) {
    options = options || { immediateDefault: false };
    if (!sel) return;
    var $el = $(sel);
    if($el.length > 1) console.warn('selected more than 1 element for reclick', $el.length, sel);
    if($el.length){
      if(options.immediateDefault){
        $el.first().one('click', function(e){ e.preventDefault(); });
      }
      var elClass = $el.attr('class') || '';
      var elHref = $el.attr('href') || '';
      if (elClass.match('fancybox')) {
        // fancybox is a click handler on a link
        $el.click();
      } else if (elHref && (elHref != '#')) {
        if ($el[0].hasAttribute('data-js-href')) {
          // sometimes links have an href for semantic purposes (ex: adaptive tab header)
          $el.click();
        } else {
          // cart link
          if ($el.attr('target') == '_blank') window.open(elHref);
          else window.location = elHref;
        }
      } else if (($el[0].nodeName||'').toUpperCase() == 'INPUT') {
        if($el.is(':visible')) $el.focus();
        else $el.blur();
      } else if (
        (elClass.match('is-specItem')||elClass.match('is-brandItem')||elClass.match('is-cValueItem')||elClass.match('is-cadItem')||elClass.match('is-daysToShipItem')||elClass.match('is-categoryItem')||elClass.match('is-stockItem')) 
          && (!elClass.match('is-stockItemToggle')) 
          && (!elClass.match('is-campaignItemToggle')) ) {
        if($el.hasClass('on')) $el.removeClass('on')
        $el.click();
      } else if (elClass.match('m-toggleSwitch')||elClass.match('m-campaignItem')||elClass.match('m-stockItem')){
        var $input = $el.find('input');
        $input.click();
      } else if(elClass.match('is-stockItemToggle')|| elClass.match('is-campaignItemToggle')|| elClass.match('is-noModal') || elClass.match('is-specInputItem')) {
      } else if (($el[0].nodeName||'').toUpperCase() == 'LABEL' && $el[0].hasAttribute('for')) {
        var $input = $el.find('input');
        if ($input.length > 0) $input.click();
        else $el.click();
      } else if ($el.is('select.c-specOption__control')) {
        $el.trigger('change');
      } else if ($el[0].hasAttribute('data-rxjs')) {
        // jquery click doesn't trigger rxjs fromEvent (ex: cad download)
        var e = document.createEvent('Event');
        e.initEvent('click', true, true);
        $el[0].dispatchEvent(e);
      } else {
        $el.click();
      }
    }
  };

  vonaLight.bootstrapInteractive = function(e, options) {
    options = options || {
      callback_vona2Load: function(){},
      stopImmediatePropagation: false,
      immediateDefault: false,
    };
    if(e){
      if(!options.immediateDefault) e.preventDefault();
      if(options.stopImmediatePropagation) e.stopImmediatePropagation();
    }
    var origTarget = e && e.currentTarget;
    if(!origTarget) origTarget = e && e.target;
    var origSel = e && e.handleObj && e.handleObj.selector;
    var deferredClick = function() {
      //setTimeout: race condition with echistory.restoreState; if restoreState happens later it can undo our click
      if (functions.taskECHistory && functions.taskECHistory.restorePending) return setTimeout(deferredClick, 10);

      // e.target won't work because the header gets re-rendered
      // a path to the element won't work because the dom gets significantly rewritten
      var reclickOptions = { immediateDefault: !!options.immediateDefault };
      if (origTarget && document.body.contains(origTarget)) reclick(origTarget, reclickOptions);
      else if (origTarget && origTarget.id) reclick('#'+origTarget.id, reclickOptions);
      else if (origTarget && $(origTarget).attr('href') && $(origTarget).attr('href') != '#') reclick('[href="'+$(origTarget).attr('href')+'"]', reclickOptions);
      else if (origSel) reclick(origSel, reclickOptions);
    };
    vonaLight.loadVona2().then(function(){
      if(options.callback_vona2Load) options.callback_vona2Load();
      deferredClick();
    });
  };

  vonaLight.addBootstrapTriggers = function(f) {
    f();
  }

  var bindBootstrap = function bindBootstrap() {
    $('body').on('click.bootstrap', '[data-login=loginButton]', vonaLight.bootstrapInteractive);
    $('body').on('click.bootstrap', '[data-header-func=cart]',vonaLight.bootstrapInteractive);
    $('body').on('click.bootstrap', '.l-meganav__button [data-miniorderpad-btn]', vonaLight.bootstrapInteractive);
    $('body').on('click.bootstrap', '.m-btn--headerQuoteIcon[data-miniorderpad-btn], .m-btn--headerOrderIcon[data-miniorderpad-btn]', vonaLight.bootstrapInteractive);
    $('body').on('click.bootstrap', '[data-action=taxExemption],[data-action=feedbackSurvey]', vonaLight.bootstrapInteractive);
    $('body').on('click.bootstrap', '[data-require-auth]', vonaLight.bootstrapInteractive);
    $('body').on('click.bootstrap', '.fancybox--narrow,.fancybox--login,.fancybox,.fancybox-survey,.fancybox--html,.fancybox--movieEmbed,.fancybox--inline,.fancybox--inlineResponsive,.fancybox--movie', vonaLight.bootstrapInteractive);
    $('body').on('click.bootstrap', '[data-spec-category=stockItem]', vonaLight.bootstrapInteractive);
    $('body').on('click.bootstrap', '[data-spec-category=campaignItem]', vonaLight.bootstrapInteractive);
  };

  var selectorsToUnbind = ['body'];
  vonaLight.directInterceptSelector = function(sel) {
    selectorsToUnbind.push(sel);
    return $(sel);
  };

  var unbindBootstrap = function() {
    for (var i=0;i < selectorsToUnbind.length;i++) $(selectorsToUnbind[i]).off('.bootstrap');
    vonaLight.addBootstrapTriggers = function(f) {};
  };

  function getCartItemCount() {
    var cartItemList = localStorage.getItem('cartItemList');
    if (!cartItemList) return 0;
    try{
      cartItemList = JSON.parse(cartItemList);
    }
    catch(ex){
      return 0;
    }
    if(!cartItemList) return 0;
    return cartItemList.length;
  }

  var updateCartCount =function updateCartCount() {
    $('.lc-cart .lc-count__mobile.VN_none, .lc-cart .lc-count.VN_none').removeClass('VN_none');
    $('[data-common=cartCount]').text(getCartItemCount());
  };

  function waitForVonaLightReady(callback){
    if(window.VNLightIsReady) return callback();
    window.VNLightOnReady.push(callback);
  }
  vonaLight.waitForVonaLightReady = waitForVonaLightReady;

  // INIT replacement
  // note that INIT restore still happens, and may be required for objects that are not fully initialized at this time.
  waitForVonaLightReady(function() {vonaLight.objects.echistory.restoreState(history.state); });

  vonaLight.objects.notice_country.render();

  bindBootstrap();
  setTimeout(function(){
    if ($('.lazyscript').length > 0) {
      updateCartCount();
      window.VNLightSomeScriptsDeferred = true;
      if(vonaLight.functions.getURLParamValue('Keyword') || vonaLight.functions.getURLParamValue('categoryKeyword')){
        if(window.VNServerInfo && window.VNServerInfo.categoryCode && $('body').hasClass('category')){
          vonaLight.loadVona2({ noOverlay: true });
        }
      }
    } else {
      unbindBootstrap();
      window.VNLightSomeScriptsDeferred = false;
    }
  }, 1);
})();
